的，艾伦·B·迈克艾罗伊执导，TTOM FREDERIC，JANET MONTGOMERY等主演的一部血腥恐怖片。该片讲述的是有一批人在西弗吉尼亚州的偏僻山区被困，但他们不知道的是，他们已经进入了一个野蛮人的地盘，等待他们的只有死亡，为了生存他们开始了亡命战斗。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<figure><iframe src=\"https://api.longdidi.top/hls.php?id=6dc9YPiKI[a]vacsIh0iZusBYfZp0oMEhBGbhOYzY6BRzqivso[c]vZGBSMr14olyARgLGc2mnCRBp7FdHYAU9AjMrr0igZanjL0LWfhWHqqzg5p4mc\" class=\"movie-box hd16-9\" allowfullscreen=\"true\"></iframe></figure>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>人迹罕至的森林中，四个乘舟沿河漂流的年轻人被一名畸形的食人猎手袭击，食人狂用弓箭和陷阱将他们猎杀殆尽，只有一名名叫爱丽丝（Janet Montgomery 饰）的姑娘侥幸逃脱。几乎与此同时，西弗吉尼亚州的葛夫顿监狱中，狱警尼特（Tom Frederic 饰）和搭档接到了一项任务：将墨西哥裔犯人查韦斯（Tamer Hassan 饰）等人转移到另一所监狱。为了防止查韦斯的同伙于路劫车，监狱安排卧底乔装成犯人与查韦斯同行，然而意外还是发生了，囚车在荒凉的山路上被食人狂驾驶的车子撞下悬崖…… 囚犯们夺走枪支反客为主，尼特因为熟悉地形而担任向导，大难不死的爱丽丝出现在这支混合囚犯与狱警的队伍前面，她带来了食人狂的信息，夜色深锁的密林中，疯狂而又漫长的一夜刚刚才开始……</p>\n<!-- /wp:paragraph -->','电影·致命弯道3','','publish','open','open','','wrong-turn3','','','2020-06-29 13:19:22','2020-06-29 05:19:22','',0,'http://apiclo.vicp.io/?p=82',0,'post','',0),(83,1,'2020-06-27 13:33:54','2020-06-27 05:33:54','','wrong-turn3','','inherit','open','closed','','wrong-turn3','','','2020-06-27 13:33:54','2020-06-27 05:33:54','',82,'http://apiclo.vicp.io/wp-content/uploads/2020/06/wrong-turn3.jpg',0,'attachment','image/jpeg',0),(84,1,'2020-06-27 13:35:56','2020-06-27 05:35:56','<!-- wp:paragraph -->\n<p>《致命弯道3》是由20世纪福克斯电影公司出品的，艾伦·B·迈克艾罗伊执导，TTOM FREDERIC，JANET MONTGOMERY等主演的一部血腥恐怖片。该片讲述的是有一批人在西弗吉尼亚州的偏僻山区被困，但他们不知道的是，他们已经进入了一个野蛮人的地盘，等待他们的只有死亡，为了生存他们开始了亡命战斗。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<figure><iframe src=\"https://api.longdidi.top/hls.php?id=1d479hZjoU[c]I9puqUp51KXQFzFzbCafGDnVf7o[a]Gt74q[a]RKInZdmkpYYz7nw564xsBZva04I5E6[c]JhodcUQHi2MCYlCc7eb2zsDMyLJhuAdv\" allowfullscreen=\"true\"></iframe></figure>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>人迹罕至的森林中，四个乘舟沿河漂流的年轻人被一名畸形的食人猎手袭击，食人狂用弓箭和陷阱将他们猎杀殆尽，只有一名名叫爱丽丝（Janet Montgom