j9CCupnsqpxAI07WS4jKrhtHZ7I7cwLeT3XfUstWKiFfZGVeHV9jsM7449rfptfFI[c]ZWUVV[c]rMbQ[c]v5WLoIGXOfoPqRuKlPCtGtmUuC\" style=\"\nwidth:100%;\nheight:370px;\nborder-radius:7px;\nbox-shadow:0px 5px 15px #000; \n \" allowfullscreen=\"true\"></iframe></figure>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>在名为“最后的幸存者”的冒险真人秀节目中，六个年轻人将在教官代尔（亨瑞·罗林斯 Henry Rollins 饰）的领导下，在虚拟的世界末日环境下展开关系到生死存亡的争斗，6天之后，唯一幸存下来的选手即能获得高额的奖金。野心勃勃的妮娜（艾丽卡·李尔森 Erica Leerhsen 饰）不巧和作为替补队员半推半就而来的马拉（阿莱卡萨·帕拉迪诺 Aleksa Palladino 饰）被分在了一组，游戏正式开始。 令所有人没有想到的是，他们的到来让一群长久以来生活在这片土地上的畸形食人族们感到无比兴奋，选手们接连遇害成为了它们的盘中饕餮。在目睹了马拉被残忍杀害后，妮娜决定要为自己的生命而战，不久之后，代尔和队友杰克（Texas Battle 饰）也加入了战斗，他们能够战胜凶残的食人族吗？</p>\n<!-- /wp:paragraph -->','电影·致命弯道2','','inherit','closed','closed','','70-autosave-v1','','','2020-06-27 13:36:33','2020-06-27 05:36:33','',70,'http://apiclo.vicp.io/70-autosave-v1/',0,'revision','',0),(87,1,'2020-06-27 13:36:49','2020-06-27 05:36:49','<!-- wp:paragraph -->\n<p>《致命弯道3》是由20世纪福克斯电影公司出品的，艾伦·B·迈克艾罗伊执导，TTOM FREDERIC，JANET MONTGOMERY等主演的一部血腥恐怖片。该片讲述的是有一批人在西弗吉尼亚州的偏僻山区被困，但他们不知道的是，他们已经进入了一个野蛮人的地盘，等待他们的只有死亡，为了生存他们开始了亡命战斗。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<figure><iframe src=\"https://api.longdidi.top/hls.php?id=1d479hZjoU[c]I9puqUp51KXQFzFzbCafGDnVf7o[a]Gt74q[a]RKInZdmkpYYz7nw564xsBZva04I5E6[c]JhodcUQHi2MCYlCc7eb2zsDMyLJhuAdv\" \n style=\"\nwidth:100%;\nheight:370px;\nborder-radius:7px;\nbox-shadow:0px 5px 15px #000; \n \"allowfullscreen=\"true\"></iframe></figure>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>人迹罕至的森林中，四个乘舟沿河漂流的年轻人被一名畸形的食人猎手袭击，食人狂用弓箭和陷阱将他们猎杀殆尽，只有一名名叫爱丽丝（Janet Montgomery 饰）的姑娘侥幸逃脱。几乎与此同时，西弗吉尼亚州的葛夫顿监狱中，狱警尼特（Tom Frederic 饰）和搭档接到了一项任务：将墨西哥裔犯人查韦斯（Tamer Hassan 饰）等人转移到另一所监狱。为了防止查韦斯的同伙于路劫车，监狱安排卧底乔装成犯人与查韦斯同行，然而意外还是发生了，囚车在荒凉的山路上被食人狂驾驶的车子撞下悬崖…… 囚犯们夺走枪支反客为主，尼特因为熟悉地形而担任向导，大难不死的爱丽丝出现在这支混合囚犯与狱警的队伍前面，她带来了食人狂的信息，夜色深锁的密林中，疯狂而又漫长的一夜刚刚才开始……</p>\n<!-- /wp:paragraph -->','电影·致命弯道3','','inherit','closed','closed','','82-revision-v1','','','2020-06-27 13:36