弯道》是一部美德合拍的血腥恐怖电影，又名肢解狂魔 / 致命弯路 / 鬼挡墙 / 鬼挡路。影片由罗伯施·密特导演，德斯蒙德·哈林顿主演，于2003年上映。该片主要讲述几名误入森林的游客在废弃弯道逃离畸形人追杀的故事。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<figure><iframe src=\"https://api.longdidi.top/hls.php?id=df75n1[a]x3SAGMEFIggUZaI1BoZW8aESPxrYHZlOHls7WUgBIPmu[a][c]GyTKCtkAyAKb1CBd[a]7Pm1ATagpU[c]gEoj977RmGQPRNV5c[c]NeC1[c]tKhn\" class=\"movie-box hd16-9\" allowfullscreen=\"true\"></iframe></figure>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>克里斯（Desmond Harrington 戴斯蒙•哈林顿 饰）接到一份紧急的采访任务，他必须在3个小时之内赶到美国北卡罗来纳州的罗利市。原本应该顺利的形成却被一起交通事故打乱，一辆运载化学品的车辆翻倒，导致高速公路大塞车。万般无奈之下，克里斯选择一条人烟稀少的小路行进。 另一方面，杰西（Eliza Dushku 艾丽莎•杜舒 饰）、卡莉（Emmanuelle Chriqui 曼纽尔•克莉琪 饰）、斯科特（Jeremy Sisto杰瑞米•西斯托 饰）、埃文（Kevin Zegers 凯文•席格斯 饰）和弗朗丝（Lindy Booth 林蒂•布丝 饰）等5位好友驱车前往山中露营游玩。谁知汽车半路离奇爆胎，等待救援时汽车又被突遇险情的克里斯撞上。众人结伴去附近求助，却未料到走入了变态食人魔所设下的重重陷阱……</p>\n<!-- /wp:paragraph -->','电影·致命弯道1','','inherit','closed','closed','','60-revision-v1','','','2020-06-27 13:51:46','2020-06-27 05:51:46','',60,'http://apiclo.vicp.io/60-revision-v1/',0,'revision','',0),(94,1,'2020-06-27 13:52:38','2020-06-27 05:52:38','<!-- wp:paragraph -->\n<p>《致命弯道》是一部美德合拍的血腥恐怖电影，又名肢解狂魔 / 致命弯路 / 鬼挡墙 / 鬼挡路。影片由罗伯施·密特导演，德斯蒙德·哈林顿主演，于2003年上映。该片主要讲述几名误入森林的游客在废弃弯道逃离畸形人追杀的故事。</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<figure><iframe src=\"https://api.longdidi.top/hls.php?id=bdc7hOPEFoHm[a]qHI94i5bheNuRMLpE6quGvqusuWaprY1tgJNjIRnScu52xN97z6m9gj6[a]TTIQ8mPSQwmPeKqnsjNkfSV6ITyPqSsVERsMXC3A\" class=\"movie-box hd16-9\" allowfullscreen=\"true\"></iframe></figure>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>克里斯（Desmond Harrington 戴斯蒙•哈林顿 饰）接到一份紧急的采访任务，他必须在3个小时之内赶到美国北卡罗来纳州的罗利市。原本应该顺利的形成却被一起交通事故打乱，一辆运载化学品的车辆翻倒，导致高速公路大塞车。万般无奈之下，克里斯选择一条人烟稀少的小路行进。 另一方面，杰西（Eliza Dushku 艾丽莎•杜舒 饰）、卡莉（Emmanuelle Chriqui 曼纽尔•克莉琪 饰）、斯科特（Jeremy Sisto杰瑞米•西斯托 饰）、埃文（Kevin Zegers 凯文•席格斯 饰）和弗朗丝（Lindy Booth 林蒂•布丝 饰）等5位好友驱车前往山中露营游玩。谁知汽车半路离奇爆胎，等待救援时汽车又被突遇险情的克里斯撞上。众人结